    const rows = csvContent.split('\n');
    const headers = rows[0].split(',');

    // Crear la fila de encabezados
    const thead = document.createElement('thead');
    const headerRow = document.createElement('tr');

    headers.forEach(headerText => {
        const th = document.createElement('th');
        th.textContent = headerText;
        headerRow.appendChild(th);
    });

    thead.appendChild(headerRow);
    table.appendChild(thead);

    // Función para crear las celdas de la tabla
    function createTableCell(content) {
        const td = document.createElement('td');
        td.textContent = content;
        return td;
    }

    // Función para crear las filas de la tabla
    function createTableRow(rowData) {
        const row = rowData.trim().split(',');
        const tr = document.createElement('tr');
        row.forEach(data => tr.appendChild(createTableCell(data)));
        return tr;
    }

    // Llenar la tabla con los datos del CSV
    rows.forEach((rowData, index) => {
        if (index > 0) {
            table.appendChild(createTableRow(rowData));
        }
    });

    // Crear el input de filtro por Ramo
    const filterInput = document.createElement('input');
    filterInput.setAttribute('type', 'text');
    filterInput.setAttribute('placeholder', 'Filtrar por Ramo');
    document.body.insertBefore(filterInput, table);

    // Evento al escribir en el filtro
    filterInput.addEventListener('keyup', function() {
        const filterValue = filterInput.value.toLowerCase();
        const rows = table.getElementsByTagName('tr');

        for (let i = 1; i < rows.length; i++) {
            const lastName = rows[i].getElementsByTagName('td')[1];

            if (lastName) {
                const txtValue = lastName.textContent || lastName.innerText;

                if (txtValue.toLowerCase().indexOf(filterValue) > -1) {
                    rows[i].style.display = '';
                } else {
                    rows[i].style.display = 'none';
                }
            }
        }
    });

    // Botón de redireccionamiento
